import React from 'react';
import logo from '../../img/willchat.png';
import './Header.css';
export default function Header(props) {
    return (
        <div id="header">
            <img src={logo}></img>
            <div className="logout">
                <button type="submit" class="btn btn-primary btn-sm">Edit Profile</button>
                <button type="submit" class="btn btn-primary btn-sm">Log Out</button>
            </div>
        </div>
    );
}
